						<div itemprop="articleBody">
		<p>I september 2005 afholdes den 15. Nordeuropæiske Kongres på Island, hvor værterne var den nystiftede islandske kvindelige lægeforening. Deltagerne kom fra de nordiske lande, England, Irland og repræsentanter fra de baltiske lande, Holland o.a. Kongressen varede varede 3 dage og emnerne var: Medical Women - their personal experiences and uotside views, Women's Mental Health, Heart and Lung diseases, Leadership for Medical Women - a toolkit for professionals "Gender Mainstreaming" og "Look to the future".</p>	</div>

	
